// @ts-ignore
import s from './Header.module.css';

export const Header = () => {
    return <header className={s.header}>
        <h1>HEADER</h1>
        <img src="https://cdn3.iconfinder.com/data/icons/colorful-guache-social-media-logos-1/159/social-media_web-512.png"/>

    </header>
};
